def calculate_determinant(matrix):
    det_val = 0
    rows = len(matrix)
    cols = len(matrix[0])

    # iterate over matrix
    for r1 in range(rows):
        for r2 in range(cols):
            for j in range(cols):
                det_val += matrix[r1][j]*matrix[r2][j]*int(matrix[r1][r2]) if matrix[r1][j] != 0 else 0
    return det_val
